EXECUTE IMMEDIATE Q'/CREATE OR REPLACE VIEW SPF_V_PAUDITMAIN AS
SELECT  A.DATAKEY,
(SELECT AG.NAME FROM CODE_T_AGENCY_SPF AG WHERE AG.GUID=A.AGENCYID) AS REPORTAGENCY,
          A.AGENCYID,
         F.FIRAGENCYID,
         AGENCY.NAME AGENCYNAME,
         A.SPFID,
         A.PROJTYPEID,
         F.SPFNAME,
         A.PROJECTID,
         A.PROJCODE,
         A.PROJNAME  PROJNAME,
         A.PROJNAME||'{'||A.PROJECTID||'}' PROJGROUP_NAME,
       (SELECT  ACCT.NAME FROM CODE_V_ACCTCODE_OUT_SPF  ACCT WHERE ACCT.GUID  = A.EXPFUNCID) AS EXPFUNCCLASS,
        A.CREATEUSER,
        A.CREATETIME,
        A.IMPORTANCE,
        A.DISTRICTID,
        PB.ISBGT,
        NVL(PB.CHECKSTATUS,'0') CHECKSTATUS,
        A.ISINSTEAD,
        A.ISTEMP,
        F.FUNDLEVEL,
        F.EXPFUNCID,
        A.ISGROVPROC
    FROM SPF_T_PBASEINFO A ,CODE_T_FIRAGENCY AGENCY, SPF_T_FBASEINFO F，SPF_T_PBASESTATUS PB
    WHERE F.FIRAGENCYID = AGENCY.GUID AND A.SPFID = F.SPFID AND A.PROJECTID = PB.PROJECTID/';
